long_desc.thetext:
The effect qx.fx.effect.combination.Pulsate seems to have problems when the effect is executed several times while the browser is busy with some other tasks.

This problem can be reproduced the the appended code that can be run in the qooxdoo playground:
The demo program displays some buttons.
When a button is clicked, the button starts to pulsate and then starts a calculation.
If the buttons are clicked very often and very fast, the buttons will stay partly faded out after the pulsate effect is finished, see attached screenshot.

This problem is reproducible in the Firefox and the Internet Explorer.

-- ---------------------------------------------------------
var button1 = new qx.ui.form.Button("First Button", "icon/22/apps/internet-web-browser.png");
var button2 = new qx.ui.form.Button("First Button", "icon/22/apps/internet-web-browser.png");
var button3 = new qx.ui.form.Button("First Button", "icon/22/apps/internet-web-browser.png");

// Document is the application root
var doc = this.getRoot();

// Add button to document at fixed coordinates
doc.add(button1, {left : 100, top  : 50 });
doc.add(button2, {left : 100, top  : 80 });
doc.add(button3, {left : 100, top  :110 });

var calcSomething= function(a,b) {
   var x = 99.3;
   var y = 32.3;
   for(var i=0;i<10000;i++) {
     var z = x / y;
     for(var j=0;j<1000;j++) {
       z = z / y;
     }
   }
};

qx.event.Timer.once( function() {
  var effect1 = new qx.fx.effect.combination.Pulsate(
         button1.getContentElement().getDomElement()).set({duration: 1});
  var effect2 = new qx.fx.effect.combination.Pulsate(
         button2.getContentElement().getDomElement()).set({duration: 1});
  var effect3 = new qx.fx.effect.combination.Pulsate(
         button3.getContentElement().getDomElement()).set({duration: 1});
  button1.addListener("execute", function(e) { effect1.start(); calcSomething(); });
  button2.addListener("execute", function(e) { effect2.start(); calcSomething(); });
  button3.addListener("execute", function(e) { effect3.start(); calcSomething(); });
  }, this, 1000 );

This might be a solution as quick-fix (pasteable in playground):

--snip--
var button1 = new qx.ui.form.Button("First Button",
"icon/22/apps/internet-web-browser.png");
var button2 = new qx.ui.form.Button("First Button",
"icon/22/apps/internet-web-browser.png");
var button3 = new qx.ui.form.Button("First Button",
"icon/22/apps/internet-web-browser.png");

// Document is the application root
var doc = this.getRoot();

// Add button to document at fixed coordinates
doc.add(button1, {left : 100, top  : 50 });
doc.add(button2, {left : 100, top  : 80 });
doc.add(button3, {left : 100, top  :110 });

var calcSomething= function(a,b) {
   var x = 99.3;
   var y = 32.3;
   for(var i=0;i<1000;i++) {
     var z = x / y;
     for(var j=0;j<1000;j++) {
       z = z / y;
     }
   }
};

qx.event.Timer.once( function() {
  var effect1 = new qx.fx.effect.combination.Pulsate(
         button1.getContentElement().getDomElement()).set({duration: 1});
  var effect2 = new qx.fx.effect.combination.Pulsate(
         button2.getContentElement().getDomElement()).set({duration: 1});
  var effect3 = new qx.fx.effect.combination.Pulsate(
         button3.getContentElement().getDomElement()).set({duration: 1});
  button1.addListener("execute", function(e) { startAnimation(effect1); });
  button2.addListener("execute", function(e) { startAnimation(effect2); });
  button3.addListener("execute", function(e) { startAnimation(effect3); })
}, this, 1000 );

var running = false;

var startAnimation = function(effect)
{
  effect.addListener("finish", function() { running = false; });
  qx.log.Logger.debug(running);
  if (!running) {
    effect.start();
    running = true;
  }
  calcSomething();
};
--snip--

The main concern here is to not to start an animation while one is running. This should fix this issue within application code.

In the new animation layer this is the usual case. It does rely on CSS3 (for modern browsers) and in this case you don't want to start the animation over and over again. This would lead to the wrong result.

So let's just stick with this solution here which will be compliant with the new layer.
